import React from 'react';
import style from './starry.jpg';
import contents from './mountains.jpeg';
import output from '/output.png';


const NSTExample = () => {
  return (
    <div>
      <img className='ma4 mt0 center' style={{width: '60%', height: 'auto' }} src={contents} alt='' />
      <img className='ma4 mt0 center' style={{width: '60%', height: 'auto' }} src={style} alt='' />
      <img className='ma4 mt0 center' style={{width: '60%', height: 'auto' }} src={output} alt='' />
    </div>
  );
}

export default NSTExample
